// src/modules/dataTables/DataCatalog.jsx
import React from "react";
import { Link } from "react-router-dom";

const DATA_FILES = [
  { name: "PM Correction Factor", file: "pmSpeedGradeFiv.json" },
  { name: "CO Correction Factor", file: "coSpeedGradeFiv.json" },
  { name: "NOx Correction Factor", file: "noxSpeedGradeFiv.json" }
];

export default function DataCatalog() {
  return (
    <div style={{ padding: 16 }}>
      <h2>Data Tables Catalog</h2>
      <p>Select a file to view its full table.</p>
      <ul>
        {DATA_FILES.map((d) => (
          <li key={d.file}>
            <Link to={`/tables/${d.file}`} target="_blank" rel="noreferrer">
              {d.name}
            </Link>
          </li>
        ))}
      </ul>
    </div>
  );
}
